import React, { useState } from 'react';
import axios from 'axios';

const UpdateTicketPrice = () => {
  const [ticketId, setTicketId] = useState('');
  const [price, setPrice] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.patch(`http://localhost:5000/tickets/${ticketId}/price`, { sellingPrice: price });
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" value={ticketId} onChange={(e) => setTicketId(e.target.value)} placeholder="Ticket ID" />
      <input type="text" value={price} onChange={(e) => setPrice(e.target.value)} placeholder="New Price" />
      <button type="submit">Update Price</button>
    </form>
  );
};

export default UpdateTicketPrice;
